  false,\n\t\"url\": null,\n\t\"notes\": \"This publication presents lidar data collected
  over the community of Golovin, on the southern coast of the Seward Peninsula in
  western Alaska (fig. 1). The original data were collected on November 5, 2013, by
  Quantum Spatial. The complete, classified lidar dataset was purchased by the State
  of Alaska Division of Geological & Geophysical Surveys in 2014 in support of coastal
  vulnerability mapping efforts. For the purposes of open access to lidar datasets
  in coastal regions of Alaska, this collection is being released as a Raw Data File
  with an open end-user license. The horizontal datum for this dataset is NAD83 (CORS96),
  the vertical datum is NAVD88, Geoid 09, and it is projected in UTM Zone 3 North.
  Units are in Meters. Data have been classified to Ground (class 2) and Default (class
  1). Quantum Spatial collected the Golovin LiDAR data on 11/05/2013.\",\n\t\"owner_org\":
